import 'dart:convert';

import 'package:shelf/shelf.dart';
import 'package:shelf_router/shelf_router.dart';

final _image1 =
    '';
final _image2 =
    '';
final _image3 =
    '';
final _image4 =
    '';
final _image5 =
    '';
final _image6 =
    '';

final _images = {
  'i1': _image1,
  'i2': _image2,
  'i3': _image3,
  'i4': _image4,
  'i5': _image5,
  'i6': _image6,
};

Response getImage(Request request) {
  final image = _images[request.params['image_id']];
  if (image == null) {
    return Response.notFound('Image not found');
  }

  // Decode the base64 string to a list of bytes
  final imageBytes = base64Decode(image);

  // Return the image as a PNG
  return Response.ok(
    imageBytes,
    headers: {
      'Content-Type': 'image/png',
      'Content-Length': imageBytes.length.toString(),
    },
  );
}
